                <p className='OllUsers-card-name'>{user.name}</p>
                <p className='OllUsers-card-email'>{user.email}</p>
                <p className='OllUsers-card-email'>{user.balance}</p>
                <p>id: {user._id}</p>
            </div>
          )}      
     </div>
        ) : (
            <div>
                <p className='OllUsers-noUsers'>No users</p>
            </div>
        )}


    </div>
  )
}

export default UserOrders
